import React, { Component } from 'react'; 
import './App.css';

// Function that displays the heading message and the date
function appHeading(){
  // Variables that will be used for the heading of the web app
  const title = 'Juan\'s To-Do List';
  let date = new Date().toLocaleDateString();

  // Make the heading into one variable by using the two above variables 
  const heading = (
    <div className ="Heading">
      <h1>{title}</h1>
      <h2>Today's date is {date}</h2>
    </div>
  );

  // Return the heading
  return(heading);  
}

class App extends React.Component{
  render(){
    return(
      <div>
        appHeading();
      </div>
    );
  }
}
export default App;
